from PyQt5.QtWidgets import QMainWindow, QMessageBox, QProgressBar
import zebraui
import pyperclip    # Работа с буфером обмена
from zebra import Zebra


class ZplPrinter(QMainWindow, zebraui.Ui_ZplWindow):
    def __init__(self, parent, codes = [], group = None, **kwargs) -> None:
        super().__init__(parent)
        self.setupUi(self)  # Это для инициализации  дизайна
        self.escapes = '/|@`'
        self.parent = parent
        self.codes = codes
        self.options = parent.options
        self.progress_bar = QProgressBar()
        self.progress_bar.setRange(0,100)
        self.statusBar().addPermanentWidget(self.progress_bar)
        self.progress_bar.hide()
        self.statusBar().showMessage(f'Выбрано кодов для печати: {len(codes)}', 0)
        self.group = group
        #for key, value in kwargs.items():
        #    if key == 'number':
        #        self.number = value
        #    elif key == 'type':
        #        self.code_type = value            
        self.z = Zebra()
        self.cbPrinter.addItems(self.z.getqueues())
        self.defaultlabel = DEFAULT_LABEL
        self.accept_actions()

    def accept_actions(self):
        self.btnOk.clicked.connect(self.accept)
        self.btnCancel.clicked.connect(self.reject)
        self.btnTestPrint.clicked.connect(self.on_testprint)
        self.btnExample.clicked.connect(self.on_copyclipboard)
        self.btnDefault.clicked.connect(self.on_default)

    def accept(self):
        #z = Zebra()
        #z.setqueue(z.getqueues()[0])
        self.z.setqueue(self.z.getqueues()[self.cbPrinter.currentIndex()])
        #+++++codes = self.parent.data_frame['gs1dm'].tolist()
        label_first = "^XA"        
        if self.gbGraphics.isChecked():
            label_first = label_first + f'''^FO{self.leBackLeft.text()}, {self.leBackTop.text()}{self.pBackImage.toPlainText()}'''
        for i in range(len(self.codes)):
            ESCAPE=''
            for symbol in self.escapes:
                if symbol not in self.codes[i]:
                    ESCAPE = symbol
                    break 
            if ESCAPE != '':
                #print(ESCAPE)
                label = label_first + f'''^FO{self.leDMLeft.text()},{self.leDMTop.text()}^BX{self.getRotation(self.cbDMRotate.currentIndex())},{self.cbDMHeight.currentText()},200,26,26,,{ESCAPE},1^FD{ESCAPE}1{self.codes[i]}^FS'''
                if self.gbText.isChecked():
                    label = label + f'''^FB{str(self.leTextField.text())},1,0,C,0^FO{self.leTextLeft.text()},{self.leTextTop.text()},{str(self.cbTextAlign.currentIndex())}^A0{self.getRotation(self.cbTextRotate.currentIndex())},{self.sbFontSize.value()}'''
                    if self.cbNumeric.currentIndex() == 1:
                        if self.group == 'K':
                            label = label + f'''^FD{i*int(self.parent.leKCount.text())+1}-{(i+1)*int(self.parent.leKCount.text())}\&^FS'''
                        elif self.group == 'P':
                            pass  # - сгенерировать штрих-код
                        else:
                            label = label + f'''^FD{i+1}\&^FS'''
                    else:
                        label = label + f'''^FD{self.codes[i][16:self.codes[i].find('9')]}\&^FS'''

                    #label = label + f'''^FO{self.leTextLeft.text()},{self.leTextTop.text()},{str(self.cbTextAlign.currentIndex())}^A0{self.getRotation(self.cbTextRotate.currentIndex())},{self.sbFontSize.value()}^FD{code[16:code.find('9')]}\&^FS'''
                label = label + '^XZ'
                print(label)    
                #self.z.output(label)
            else:
                QMessageBox.warning(None, "Печать Datamatrix...", f'Код {self.codes[i]} не распечатан!')
        self.close()

    def on_testprint(self):
        self.z.setqueue(self.z.getqueues()[self.cbPrinter.currentIndex()])
        label_first = "^XA"        
        if self.gbGraphics.isChecked():
            label_first = label_first + f'''^FO{self.leBackLeft.text()},{self.leBackTop.text()}{self.pBackImage.toPlainText()}'''

        code = self.codes[0]
        ESCAPE=''
        for symbol in self.escapes:
            if symbol not in code:
                ESCAPE = symbol
                break 
        if ESCAPE != '':
            label = label_first + f'''^FO{self.leDMLeft.text()},{self.leDMTop.text()}
^BX{self.getRotation(self.cbDMRotate.currentIndex())},{self.cbDMHeight.currentText()},200,26,26,,{ESCAPE},1
^FD{ESCAPE}1{code}^FS'''
            if self.gbText.isChecked():
                label = label + f'''^FB{str(self.leTextField.text())},1,0,C,0^FO{self.leTextLeft.text()},{self.leTextTop.text()},{str(self.cbTextAlign.currentIndex())}
^A0{self.getRotation(self.cbTextRotate.currentIndex())},{self.sbFontSize.value()}'''
                if self.cbNumeric.currentIndex() == 1:
                    if self.group == 'K':
                        label = label + f'''^FD{self.parent.data_frame['gs1dm'].count()}-{self.parent.data_frame['gs1dm'].count()}\&^FS'''
                    elif self.group == 'P':
                        label = f'''^XA^FO100,400,2^BY5,3^BCN,400,Y,N,N,N^FD{self.parent.leFsrar_id.text()}{str((self.parent.cbPType.currentIndex()+1)*2)}5524{self.parent.leOrderNumber.text()}00001^FS'''
                    else:
                        label = label + f'''^FD{len(self.codes)}\&^FS'''
                else:
                    label = label + f'''^FD{code[16:code.find('9')]}\&^FS'''
            label = label + '^XZ'
            print(label)    
            #self.z.output(label)

    def reject(self):
        # - не предполагает изменения в БД
        self.close()

    def on_copyclipboard(self):
        pyperclip.copy(self.defaultlabel) #Копирует в буфер обмена информацию
        pyperclip.paste()
        QMessageBox.information(None, "Подготовка макета...", 'Пример этикетки для загрузки в принтер Zebra\nскопирован в буфер обмена.\nДля проверки и предварительного просмотра\nперейдите на сайт:\nhttps://labelary.com/viewer.html')

    def on_default(self):
        self.leDMLeft.setText('100')
        self.leDMTop.setText('100')
        self.cbDMRotate.setCurrentIndex(0)
        self.gbText.setChecked(True)
        self.leTextLeft.setText('120')
        self.leTextTop.setText('120')
        self.cbTextAlign.setCurrentIndex(2)
        self.cbTextRotate.setCurrentIndex(0)
        self.sbFontSize.setValue(18)
        self.gbGraphics.setChecked(True)
        self.leBackLeft.setText('0')
        self.leBackTop.setText('0')
        self.pBackImage.setText('')
        
    def getRotation(self, index):
        if index == 0:
            return 'N'
        elif index == 1:
            return 'R'
        elif index == 2:
            return 'I'
        else:
            return 'B'
        


